import React from 'react'
import {Text, Image} from '@chakra-ui/react'

const IsiTweet = (tweet)  => {
    return (
        <div>
            <Text fontSize="15px" color="white">{tweet}</Text>
        </div>
    )
}



export default IsiTweet
